import "./Editor.css";
import React, { Component } from 'react';
import Output from "./Output";

class Editor extends Component{
    constructor(props){
        super(props);

        this.state = {
            firstName: "First",
            lastName: "Last",
            phone: "123",
            mail: "example@mail.com",
            title: "Sofware Developer",
        }
        this.changeFirstName = this.changeFirstName.bind(this);
        this.changeLastName = this.changeLastName.bind(this);
        this.changePhone = this.changePhone.bind(this);
        this.changeMail = this.changeMail.bind(this);
        this.changeTitle = this.changeTitle.bind(this);
    }
    changeFirstName(){
        this.setState({
            firstName: document.getElementById("fnInput").value,
        })
    }
    changeLastName(){
        this.setState({
            lastName: document.getElementById("lnInput").value,
        })
    }
    changePhone(){
        this.setState({
            phone: document.getElementById("phInput").value,
        })
    }
    changeMail(){
        this.setState({
            mail: document.getElementById("mailInput").value,
        })
    }
    changeTitle(){
        this.setState({
            mail: document.getElementById("titleInput").value,
        })
    }
    render(){
        return (
            <div className="test">
                <div style={{width: "50%"}}>
                    <h1>Editor</h1>
                    <input id="fnInput" placeholder="First Name" onChange={this.changeFirstName}/>
                    <input id="lnInput" placeholder="Last Name" onChange={this.changeLastName}/>
                    <input id="titleInput" placeholder="Work Profile" onChange={this.changeTitle} />
                    <input id="phInput" placeholder="Phone" onChange={this.changePhone} />
                    <input id="mailInput" placeholder="Mail" onChange={this.changeMail} />

                </div>
                <Output data={this.state}/>
            </div>
        )
    }
}

export default Editor;
